		r, g, b = p, q, v
	elseif i == 4 then
		r, g, b = t, p, v
	elseif i == 5 then
		r, g, b = v, p, q
	end
	return math.floor(r * 255), math.floor(g * 255), math.floor(b * 255)
end

-- RGB to HSV conversion
local function rgbToHSV(r, g, b)
	r, g, b = r / 255, g / 255, b / 255
	local max = math.max(r, g, b)
	local min = math.min(r, g, b)
	local h, s, v = 0, 0, max
	local delta = max - min
	if max ~= 0 then
		s = delta / max
	end
	if delta ~= 0 then
		if max == r then
			h = (g - b) / delta
			if g < b then
				h = h + 6
			end
		elseif max == g then
			h = (b - r) / delta + 2
		elseif max == b then
			h = (r - g) / delta + 4
		end
		h = h / 6
	end
	return h, s, v
end

local function ColorPicker(win, label, initColor)
	assert(type(win) == "table", "ColorPicker: win must be a table")
	assert(type(label) == "string", "ColorPicker: label must be a string")
	assert(
		type(initColor) == "table" and #initColor >= 3,
		"ColorPicker: initColor must be a table of at least 3 numbers"
	)

	-- Layout calculations
	draw.SetFont(Globals.Style.Font)
	local txtW, txtH = draw.GetTextSize(label)
	local padding = Globals.Style.ItemPadding
	local colorSize = math.max(Globals.Style.ItemSize, txtH)
	local height = colorSize + (padding * 2)
	local previewBlockW = colorSize + (padding * 2)
	local arrowBoxW = height
	local width = previewBlockW + padding + txtW + padding + arrowBoxW

	local ctx = WidgetBase.Setup(win, "ColorPicker", label, width, height)
	local absX, absY = ctx.absX, ctx.absY
	local baseSpacing = Globals.Style.ItemSpacingY or Globals.Defaults.WINDOW_CONTENT_PADDING
	local spacingBoost = baseSpacing + padding
	if win.RequestNextLineSpacing then
		win:RequestNextLineSpacing(spacingBoost)
	end

	-- State management
	local state = Utils.GetState(win, ctx.widgetKey, {
		open = false,
		hue = 0,
		sat = 0,
		initialized = false,
		color = { initColor[1], initColor[2], initColor[3], initColor[4] or 255 },
	})

	-- Initialize hue/saturation from initial color
	if not state.initialized then
		local h, s = rgbToHSV(state.color[1], state.color[2], state.color[3])
		state.hue = h
		state.sat = s
		state.initialized = true
	end

	-- Image data for color wheel (using the preloaded image)
	local imageData = Globals.Images.ColorPicker.Interactive
	local sliderHeight = 20
	local popupBounds = {
		x = absX,
		y = absY + height,
		w = imageData.width,
		h = imageData.height + sliderHeight,
	}

	-- Interaction
	local bounds = ctx.bounds
	local hovered, pressed, clicked = WidgetBase.ProcessInteraction(ctx, state.open)

	-- Maintain popup blocked regions while open
	if state.open then
		win._widgetBlockedRegions = { popupBounds }
	end

	-- Toggle popup on field click
	if clicked and hovered and not state.open then
		state.open = true
		-- Bring window to front
		for i, id in ipairs(TimMenuGlobal.order) do
			if id == win.id then
				table.remove(TimMenuGlobal.order, i)
				break
			end
		end
		table.insert(TimMenuGlobal.order, win.id)
	end

	if state.open then
		-- Pixel selection inside popup
		local mx, my = table.unpack(input.GetMousePos())
		local px = math.floor(mx - popupBounds.x)
		local py = math.floor(my - popupBounds.y)
		if
			px >= 0
			and py >= 0
			and px < imageData.width
			and py < imageData.height
			and input.IsButtonDown(MOUSE_LEFT)
		then
			local idx = (py * imageData.width + px) * 4 + 1
			local r = string.byte(imageData.data, idx)
			local g = string.byte(imageData.data, idx + 1)
			local b = string.byte(imageData.data, idx + 2)
			local a = string.byte(imageData.data, idx + 3)
			if a ~= 0 then
				state.color[1], state.color[2], state.color[3] = r, g, b
				state.selX, state.selY = px, py
			end
		end

		-- Alpha slider interaction
		local sliderBounds =
			{ x = popupBounds.x, y = popupBounds.y + imageData.height, w = popupBounds.w, h = sliderHeight }
		local _, sPressed = Interaction.Process(win, ctx.widgetKey .. ":alpha", sliderBounds, state.open)
		if sPressed then
			local mx2, _ = table.unpack(input.GetMousePos())
			local newA = math.floor(((mx2 - sliderBounds.x) / sliderBounds.w) * 255)
			state.color[4] = math.max(0, math.min(255, newA))
		end

		-- Close popup when mouse leaves both field and popup regions
		local mx3, my3 = TimMenuGlobal.mouseX, TimMenuGlobal.mouseY
		local inField = mx3 >= absX and mx3 <= absX + width and my3 >= absY and my3 <= absY + height
		local inPopup = mx3 >= popupBounds.x
			and mx3 <= popupBounds.x + popupBounds.w
			and my3 >= popupBounds.y
			and my3 <= popupBounds.y + popupBounds.h
		if not inField and not inPopup then
			state.open = false
			win._widgetBlockedRegions = {}
		end
	end

	-- Draw field
	local px, py = absX, absY
	local bg = Globals.Colors.Item
	if pressed then
		bg = Globals.Colors.ItemActive
	elseif hovered then
		bg = Globals.Colors.ItemHover
	end
	local mainW = width - arrowBoxW
	local arrowX = px + mainW
	local colorY = py + padding
	local colorX = px + padding
	local colorX2 = colorX + colorSize
	Common.QueueRect(win, Globals.Layers.WidgetBackground, px, py, px + mainW, py + height, bg, nil)
	Common.QueueRect(
		win,
		Globals.Layers.WidgetBackground,
		arrowX,
		py,
		arrowX + arrowBoxW,
		py + height,
		Globals.Colors.ArrowBoxBg,
		nil
	)
	Common.QueueOutlinedRect(
		win,
		Globals.Layers.WidgetOutline,
		px,
		py,
		px + width,
		py + height,
		Globals.Colors.WindowBorder
	)

	-- Draw color preview
	Common.QueueRect(
		win,
		Globals.Layers.WidgetFill,
		colorX,
		colorY,
		colorX2,
		colorY + colorSize,
		state.color,
		nil
	)
	Common.QueueText(
		win,
		Globals.Layers.WidgetText,
		colorX2 + padding,
		py + (height - txtH) * 0.5,
		label,
		Globals.Colors.Text
	)

	-- Draw arrow
	draw.SetFont(Globals.Style.Font)
	local arrowCharW, arrowCharH = draw.GetTextSize("")
	local triW, triH = arrowCharW * 0.5, arrowCharH * 0.5
	local triX = arrowX + (arrowBoxW - triW) / 2
	local triY = py + (height - triH) / 2
	win:QueueDrawAtLayer(Globals.Layers.WidgetText, function()
		DrawHelpers.DrawArrow(triX, triY, triW, triH, state.open and "up" or "down", Globals.Colors.Text)
	end)

	-- Draw popup if open - use dedicated popup layer that's always on top
	if state.open then
		local popupLayer = Globals.POPUP_LAYER_BASE

		-- Popup background
		DrawManager.Enqueue(win.id, popupLayer, function()
			Common.SetColor(Globals.Colors.Window)
			Common.DrawFilledRect(
				popupBounds.x,
				popupBounds.y,
				popupBounds.x + popupBounds.w,
				popupBounds.y + popupBounds.h
			)
		end)

		-- Popup image
		DrawManager.Enqueue(win.id, popupLayer, function(tex, x0, y0, w, h)
			draw.Color(255, 255, 255, 255)
			draw.TexturedRect(tex, x0, y0, x0 + w, y0 + h)
		end, imageData.texture, popupBounds.x, popupBounds.y, imageData.width, imageData.height)

		-- Popup outline
		DrawManager.Enqueue(win.id, popupLayer, function()
			Common.SetColor(Globals.Colors.WindowBorder)
			Common.DrawOutlinedRect(
				popupBounds.x,
				popupBounds.y,
				popupBounds.x + popupBounds.w,
				popupBounds.y + popupBounds.h
			)
		end)

		-- Selection marker
		if state.selX and state.selY then
			local cx = popupBounds.x + state.selX
			local cy = popupBounds.y + state.selY
			DrawManager.Enqueue(win.id, popupLayer + 1, function()
				Common.SetColor(Globals.Colors.WindowBorder)
				draw.OutlinedCircle(cx, cy, 5, 16)
				draw.ColoredCircle(cx, cy, 4, 255, 255, 255, 150)
			end)
		end

		-- Alpha slider
		local sliderBounds =
			{ x = popupBounds.x, y = popupBounds.y + imageData.height, w = popupBounds.w, h = sliderHeight }
		DrawManager.Enqueue(win.id, popupLayer, function()
			Common.SetColor(Globals.Colors.Window)
			Common.DrawFilledRect(
				sliderBounds.x,
				sliderBounds.y,
				sliderBounds.x + sliderBounds.w,
				sliderBounds.y + sliderBounds.h
			)
			local filledW = (state.color[4] / 255) * sliderBounds.w
			Common.SetColor(Globals.Colors.ItemActive)
			Common.DrawFilledRect(
				sliderBounds.x,
				sliderBounds.y,
				sliderBounds.x + filledW,
				sliderBounds.y + sliderBounds.h
			)
			Common.SetColor(Globals.Colors.WindowBorder)
			Common.DrawOutlinedRect(
				sliderBounds.x,
				sliderBounds.y,
				sliderBounds.x + sliderBounds.w,
				sliderBounds.y + sliderBounds.h
			)
		end)

		-- Alpha slider text
		local alphaText = "Alpha: " .. tostring(state.color[4])
		DrawManager.Enqueue(win.id, popupLayer + 1, function()
			draw.SetFont(Globals.Style.Font)
			local textW, textH = draw.GetTextSize(alphaText)
			Common.SetColor(Globals.Colors.Text)
			Common.DrawText(
				sliderBounds.x + (sliderBounds.w - textW) / 2,
				sliderBounds.y + (sliderBounds.h - textH) / 2,
				alphaText
			)
		end)
	end

	return state.color
end

return ColorPicker

end)
__bundle_register("TimMenu.WidgetBase", function(require, _LOADED, __bundle_register, __bundle_modules)
-- Widget Base Utility
-- Reduces common boilerplate in widget creation
local Globals = require("TimMenu.Globals")
local Interaction = require("TimMenu.Interaction")
local Tooltip = require("TimMenu.Widgets.Tooltip")

local WidgetBase = {}

--- Handles common widget setup: counter, spacing, positioning, bounds
---@param win table Window object
---@param widgetType string Widget type name (for unique keys)
---@param label string Widget label/identifier
---@param width number Widget width
---@param height number Widget height
---@return table context Object with widget context data
function WidgetBase.Setup(win, widgetType, label, width, height)
	-- Increment widget counter
	win._widgetCounter = (win._widgetCounter or 0) + 1
	local widgetIndex = win._widgetCounter

	-- Handle horizontal spacing between widgets
	local padding = Globals.Style.ItemPadding
	if win.cursorX > Globals.Defaults.WINDOW_CONTENT_PADDING then
		win.cursorX = win.cursorX + padding
	end

	-- Get widget position from layout system
	local x, y = win:AddWidget(width, height)
	local absX, absY = win.X + x, win.Y + y

	-- Create unique widget key
	local widgetKey = win.id .. ":" .. widgetType .. ":" .. label .. ":" .. widgetIndex

	-- Widget bounds for interaction and tooltips
	local bounds = { x = absX, y = absY, w = width, h = height }

	-- Store bounds for tooltip detection
	Tooltip.StoreWidgetBounds(win, widgetIndex, bounds)

	return {
		win = win,
		widgetIndex = widgetIndex,
		widgetKey = widgetKey,
		bounds = bounds,
		x = x,
		y = y,
		absX = absX,
		absY = absY,
		width = width,
		height = height,
		padding = padding,
	}
end

--- Processes widget interaction (hover, press, click)
---@param ctx table Widget context from Setup()
---@param isPopupOpen boolean Whether widget has an open popup
---@return boolean hovered, boolean pressed, boolean clicked
function WidgetBase.ProcessInteraction(ctx, isPopupOpen)
	return Interaction.Process(ctx.win, ctx.widgetKey, ctx.bounds, isPopupOpen or false)
end

--- Gets interaction state as a string for drawing
---@param hovered boolean Whether widget is hovered
---@param pressed boolean Whether widget is pressed
---@return string state "normal", "hover", or "active"
function WidgetBase.GetDrawState(hovered, pressed)
	if pressed then
		return "active"
	elseif hovered then
		return "hover"
	else
		return "normal"
	end
end

--- Common text measurement with current font
---@param text string Text to measure
---@return number width, number height
function WidgetBase.MeasureText(text)
	draw.SetFont(Globals.Style.Font)
	return draw.GetTextSize(text)
end

return WidgetBase

end)
__bundle_register("TimMenu.DrawHelpers", function(require, _LOADED, __bundle_register, __bundle_modules)
local Common = require("TimMenu.Common")
local Globals = require("TimMenu.Globals")

--[[ Imported by: Widgets, TabControl, etc. ]]
--

local DrawHelpers = {}

----------------------------------------------------
-- DrawArrow : draws a simple filled arrow (up, down, left, or right)
-- absX, absY : top-left corner of bounding box
-- w, h       : width / height of bounding box
-- direction  : "up" | "down" | "left" | "right"
-- colorTbl   : {r,g,b,a}
----------------------------------------------------
function DrawHelpers.DrawArrow(absX, absY, w, h, direction, colorTbl)
	Common.SetColor(colorTbl or Globals.Colors.Text)

	if direction == "up" then
		Common.DrawLine(absX, absY + h, absX + w / 2, absY) -- /\ left edge
		Common.DrawLine(absX + w / 2, absY, absX + w, absY + h) -- /\ right edge
	elseif direction == "down" then
		Common.DrawLine(absX, absY, absX + w / 2, absY + h) -- \/ left edge
		Common.DrawLine(absX + w / 2, absY + h, absX + w, absY) -- \/ right edge
	elseif direction == "left" then
		Common.DrawLine(absX + w, absY, absX, absY + h / 2) -- < top edge
		Common.DrawLine(absX, absY + h / 2, absX + w, absY + h) -- < bottom edge
	elseif direction == "right" then
		Common.DrawLine(absX, absY, absX + w, absY + h / 2) -- > top edge
		Common.DrawLine(absX + w, absY + h / 2, absX, absY + h) -- > bottom edge
	end
end

----------------------------------------------------
-- DrawLabeledBox : draws a filled rect with border + centered label
----------------------------------------------------
function DrawHelpers.DrawLabeledBox(absX, absY, w, h, label, bgCol, borderCol)
	Common.SetColor(bgCol or Globals.Colors.Item)
	Common.DrawFilledRect(absX, absY, absX + w, absY + h)

	Common.SetColor(borderCol or Globals.Colors.WindowBorder)
	Common.DrawOutlinedRect(absX, absY, absX + w, absY + h)

	Common.SetColor(Globals.Colors.Text)
	draw.SetFont(Globals.Style.Font)
	local txtW, txtH = draw.GetTextSize(label)
	Common.DrawText(absX + (w - txtW) / 2, absY + (h - txtH) / 2, label)
end

