__bundle_register("TimMenu.Layout.Separator", function(require, _LOADED, __bundle_register, __bundle_modules)
local Globals = require("TimMenu.Globals")
local Common = require("TimMenu.Common")

local LayoutSeparator = {}

local function makeBoundsResolver(win)
    local pad = Globals.Defaults.WINDOW_CONTENT_PADDING
    local sectorStack = win._sectorStack
    local activeSector = sectorStack and sectorStack[#sectorStack]

    if activeSector then
        local capturedSector = activeSector
        return function()
            local left = capturedSector.startX + capturedSector.padding
            local right = math.max(left, capturedSector.maxX)
            return left, right
        end
    end

    return function()
        local left = pad
        local right = math.max(left, win.W - pad)
        return left, right
    end
end

local function drawLabelSeparator(win, y, label, resolveBounds)
    draw.SetFont(Globals.Style.Font)
    local textWidth, textHeight = draw.GetTextSize(label)
    local sepPad = Globals.Style.ItemPadding or Globals.Defaults.WINDOW_CONTENT_PADDING
    local absY = win.Y + y
    local left, right = resolveBounds()
    local absLeft = win.X + left
    local absRight = win.X + right
    local innerWidth = absRight - absLeft
    if innerWidth <= 0 then
        return
    end

    local textX = absLeft + math.max(0, (innerWidth - textWidth) / 2)
    local centerY = absY + math.floor(textHeight / 2)
    local leftLineEnd = math.max(absLeft, textX - sepPad)
    local rightLineStart = math.min(absRight, textX + textWidth + sepPad)

    Common.SetColor(Globals.Colors.WindowBorder)
    if leftLineEnd > absLeft then
        Common.DrawLine(absLeft, centerY, leftLineEnd, centerY)
    end
    Common.SetColor(Globals.Colors.Text)
    Common.DrawText(textX, absY, label)
    Common.SetColor(Globals.Colors.WindowBorder)
    if rightLineStart < absRight then
        Common.DrawLine(rightLineStart, centerY, absRight, centerY)
    end
end

local function drawLineSeparator(win, y, resolveBounds)
    local left, right = resolveBounds()
    local absLeft = win.X + left
    local absRight = win.X + right
    if absRight <= absLeft then
        return
    end
    local absY = win.Y + y
    Common.SetColor(Globals.Colors.WindowBorder)
    Common.DrawLine(absLeft, absY, absRight, absY)
end

-- The main separator function, to be called by TimMenu.Separator
function LayoutSeparator.Draw(win, label)
    assert(type(win) == "table", "Separator: win must be a table")
    assert(label == nil or type(label) == "string", "Separator: label must be a string or nil")
    local pad = Globals.Defaults.WINDOW_CONTENT_PADDING
    local vpad = Globals.Style.ItemPadding
    if win.cursorX > pad then
        win:NextLine(0)
    end
    win:NextLine(vpad)

    local height = 1
    if type(label) == "string" then
        draw.SetFont(Globals.Style.Font)
        local _, textHeight = draw.GetTextSize(label)
        height = math.max(1, textHeight)
    end

    local _, y = win:AddWidget(0, height)
    local resolveBounds = makeBoundsResolver(win)

    win:QueueDrawAtLayer(1, function()
        if type(label) == "string" then
            drawLabelSeparator(win, y, label, resolveBounds)
        else
            drawLineSeparator(win, y, resolveBounds)
        end
    end)

    win:NextLine(vpad)
end

return LayoutSeparator

end)
__bundle_register("TimMenu.Layout.Sector", function(require, _LOADED, __bundle_register, __bundle_modules)
local Globals = require("TimMenu.Globals")
local DrawManager = require("TimMenu.DrawManager") -- EndSector will need this
local Common = require("TimMenu.Common") -- EndSector might need this for DrawLine etc.

local Sector = {}

-- Spacing between rows of sectors (adjust this to change vertical gap)
local function getVerticalGap()
	return Globals.Style.ItemSpacingY or Globals.Defaults.WINDOW_CONTENT_PADDING
end

-- Horizontal spacing after a sector completes (mirrors widget spacing)
local function getHorizontalGap()
	return Globals.Style.ItemSpacingX or Globals.Defaults.ITEM_SPACING or 0
end

--[[----------------------------------------------------------------------------
-- Private Helper Functions for Sector.End
------------------------------------------------------------------------------]]

local _prepareRowState

local function _calculateDimensions(layoutState, pad)
	local currentWidth = (layoutState.maxX - layoutState.startX) + pad
	local currentHeight = (layoutState.maxY - layoutState.startY) + pad

	if type(layoutState.label) == "string" then
		draw.SetFont(Globals.Style.Font)
		local lw, _ = draw.GetTextSize(layoutState.label)
		local minContentWidthForLabel = lw + (pad * 2)
		if currentWidth < minContentWidthForLabel then
			currentWidth = minContentWidthForLabel
		end
	end
	return currentWidth, currentHeight
end

local function _registerRowEntry(win, layoutState, size)
	local row = layoutState.rowContext
	if not row then
		_prepareRowState(win, layoutState)
		row = layoutState.rowContext
	end

	table.insert(row.entries, size)

	if size.height > row.maxHeight then
		row.maxHeight = size.height
		for _, entry in ipairs(row.entries) do
			entry.height = row.maxHeight
		end
	else
		size.height = row.maxHeight
	end

	return row.maxHeight
end

local function _updatePersistentSize(win, layoutState, width, height)
	win._sectorSizes = win._sectorSizes or {}
	local persistent = win._sectorSizes[layoutState.label]
	-- Always update to current size to allow shrinking while keeping reference stable
	persistent = persistent or {}
	persistent.width = width
	persistent.height = height
	win._sectorSizes[layoutState.label] = persistent
	return persistent
end

local function _updateWindowBounds(win, layoutState, width, height, pad)
	local requiredW = layoutState.startX + width + pad
	local requiredH = layoutState.startY + height + pad
	win.W = math.max(win.W, requiredW)
	win.H = math.max(win.H, requiredH)
end

local function _enqueueBackgroundDraw(win, layoutState, depth, size)
	-- Use integer layers: each nested sector increments background layer
	local backgroundLayer = Globals.Layers.WidgetBackground + depth
	DrawManager.Enqueue(win.id, backgroundLayer, function()
		local baseBgColor = Globals.Colors.SectorBackground
		local totalLighten = math.min(40, depth * 10)
		local finalR = math.min(255, baseBgColor[1] + totalLighten)
		local finalG = math.min(255, baseBgColor[2] + totalLighten)
		local finalB = math.min(255, baseBgColor[3] + totalLighten)
		local finalColor = { finalR, finalG, finalB, baseBgColor[4] }

		local x0 = win.X + layoutState.startX
		local y0 = win.Y + layoutState.startY
		Common.SetColor(finalColor)
		Common.DrawFilledRect(x0, y0, x0 + size.width, y0 + size.height)
	end)
end

local function _enqueueBorderDraw(win, layoutState, depth, size)
	-- Use integer layers: each nested sector increments outline layer
	local borderLayer = Globals.Layers.WidgetOutline + depth
	DrawManager.Enqueue(win.id, borderLayer, function()
		local x0 = win.X + layoutState.startX
		local y0 = win.Y + layoutState.startY
		local w0 = size.width
		local h0 = size.height
		local pad0 = layoutState.padding

		Common.SetColor(Globals.Colors.WindowBorder)
		if type(layoutState.label) == "string" then
			draw.SetFont(Globals.Style.Font)
			local tw, th = draw.GetTextSize(layoutState.label)
			local labelX = x0 + (w0 - tw) / 2
			local lineY = y0
			Common.DrawLine(x0, lineY, labelX - pad0, lineY)
			Common.SetColor(Globals.Colors.Text)
			Common.DrawText(labelX, lineY - math.floor(th / 2), layoutState.label)
			Common.SetColor(Globals.Colors.WindowBorder)
			Common.DrawLine(labelX + tw + pad0, lineY, x0 + w0, lineY)
		else
			Common.DrawLine(x0, y0, x0 + w0, y0)
		end
		Common.DrawLine(x0, y0 + h0, x0 + w0, y0 + h0)
		Common.DrawLine(x0, y0, x0, y0 + h0)
		Common.DrawLine(x0 + w0, y0, x0 + w0, y0 + h0)
	end)
end

local function _finalizeCursorAndLayout(win, layoutState, width, rowHeight)
	-- Treat sector as a single widget occupying the computed width/height
	local horizontalSpacing = getHorizontalGap()
	win.cursorX = layoutState.startX + width + horizontalSpacing
	win.cursorY = layoutState.startY
	local verticalGap = getVerticalGap()
	win.lineHeight = math.max(layoutState.preLineHeight or 0, rowHeight + verticalGap)

	if #win._sectorStack > 0 then
		local parentSector = win._sectorStack[#win._sectorStack]
		parentSector.maxX = math.max(parentSector.maxX, layoutState.startX + width)
		parentSector.maxY = math.max(parentSector.maxY, layoutState.startY + rowHeight)
	end
end

function _prepareRowState(win, layoutState)
	win._sectorRows = win._sectorRows or {}
	local depth = #win._sectorStack
	local rows = win._sectorRows
	local padding = Globals.Defaults.WINDOW_CONTENT_PADDING

	local row = rows[depth]
	local startY = layoutState.startY
	local needsReset = false

	if not row then
		needsReset = true
	elseif math.abs(row.currentStartY - startY) > 0.5 then
		needsReset = true
	elseif layoutState.startX <= padding + 0.5 then
		needsReset = true
	end

	if needsReset then
		row = {
			currentStartY = startY,
			entries = {},
			maxHeight = 0,
		}
		rows[depth] = row
	else
		row.currentStartY = startY
	end

	layoutState.rowContext = row
end

--[[----------------------------------------------------------------------------
-- Public Sector API
------------------------------------------------------------------------------]]

function Sector.Begin(win, label)
	-- initialize sector stack if not already
	win._sectorStack = win._sectorStack or {}
	-- persistent storage for sector sizes
	win._sectorSizes = win._sectorSizes or {}

	-- Internal padding for content inside sector borders
	local pad = Globals.Defaults.WINDOW_CONTENT_PADDING
	-- Sector starts at current cursor position
	local startX, startY = win.cursorX, win.cursorY

	-- Start with current cursor position as initial extents (no stored sizes)
	-- Layout data tracks cursor origin, extents, and original functions
	local layoutState = {
		startX = startX,
		startY = startY,
		maxX = startX,
		maxY = startY,
		label = label,
		padding = pad,
		origAdd = win.AddWidget, -- Store original AddWidget
		preLineHeight = win.lineHeight,
	}
	table.insert(win._sectorStack, layoutState)
	_prepareRowState(win, layoutState)

	-- Reset lineHeight for clean sector start
	win.lineHeight = 0

	-- override AddWidget & NextLine to track extents within this sector
	layoutState.origNext = win.NextLine -- Store original NextLine
	win.AddWidget = function(self, w, h)
		local x, y = layoutState.origAdd(self, w, h)
		-- track widest and tallest widget positions relative to window origin
		layoutState.maxX = math.max(layoutState.maxX, x + w)
		layoutState.maxY = math.max(layoutState.maxY, y + h)
		return x, y
	end

	win.NextLine = function(self, spacing)
		-- Advance to next line within sector
		local baseSpacing = spacing or getVerticalGap()
		self.cursorY = self.cursorY + self.lineHeight + baseSpacing
		-- Keep cursor aligned to sector's left edge
		self.cursorX = layoutState.startX + layoutState.padding
		-- Reset lineHeight for new line
		self.lineHeight = 0
	end

	-- indent cursor for sector padding
	win.cursorX = layoutState.startX + layoutState.padding
	win.cursorY = layoutState.startY + layoutState.padding

	-- Override QueueDrawAtLayer to apply per-sector layer offset
	local depth = #win._sectorStack
	local groupBase = depth * Globals.LayersPerGroup
	layoutState.origQueue = win.QueueDrawAtLayer
	win.QueueDrawAtLayer = function(self, layer, fn, ...)
		-- offset layer by groupBase for this sector
		return layoutState.origQueue(self, layer + groupBase, fn, ...)
	end
end

function Sector.End(win)
	if not win._sectorStack or #win._sectorStack == 0 then
		return
	end

	local depth = #win._sectorStack
	local layoutState = win._sectorStack[depth]
	table.remove(win._sectorStack)

	win.AddWidget = layoutState.origAdd
	win.NextLine = layoutState.origNext
	local pad = layoutState.padding

	local currentWidth, currentHeight = _calculateDimensions(layoutState, pad)
	local persistentSize = _updatePersistentSize(win, layoutState, currentWidth, currentHeight)
	local rowHeight = _registerRowEntry(win, layoutState, persistentSize)
	_updateWindowBounds(win, layoutState, persistentSize.width, persistentSize.height, pad)

	-- Enqueue sector background at relative layer 0
	_enqueueBackgroundDraw(win, layoutState, depth, persistentSize)
	-- Enqueue sector border at relative layer 1
	_enqueueBorderDraw(win, layoutState, depth, persistentSize)

	-- Restore original QueueDrawAtLayer
	win.QueueDrawAtLayer = layoutState.origQueue

	-- Use calculated currentWidth/Height for layout/cursor updates, but persistent for drawing.
	_finalizeCursorAndLayout(win, layoutState, persistentSize.width, rowHeight)
end

return Sector

end)
__bundle_register("TimMenu.Window", function(require, _LOADED, __bundle_register, __bundle_modules)
local Common = require("TimMenu.Common")
local Globals = require("TimMenu.Globals")
local DrawManager = require("TimMenu.DrawManager")
local lmbx = globals -- alias for Lmaobox API

local Window = {}
Window.__index = Window

local function applyDefaults(params)
	-- Provide a fallback for each setting if not provided
	return {
		title = params.title or "Untitled",
		id = params.id or params.title,
		visible = (params.visible == nil) and true or params.visible,
		X = params.X or (Globals.Defaults.DEFAULT_X + math.random(0, 150)),
		Y = params.Y or (Globals.Defaults.DEFAULT_Y + math.random(0, 50)),
		W = params.W or Globals.Defaults.DEFAULT_W,
		H = params.H or Globals.Defaults.DEFAULT_H,
	}
end

--- __close metamethod: cleans up window state.
function Window:__close()
	self.lastFrame = nil
	self.IsDragging = false
	self.DragPos = { X = 0, Y = 0 }
end

function Window:update()
	-- Mark this window as touched this frame for pruning
	self._lastFrameTouched = lmbx.FrameCount()
end

function Window.new(params)
	-- Ensure parameters exist
	if type(params) == "string" then
		params = { title = params }
	end
	params = applyDefaults(params)

	-- Create our window object with simple composition
	local self = setmetatable({}, Window)
	self.title = params.title
	self.id = params.id
	self.visible = params.visible
	self.X = params.X
	self.Y = params.Y
	self.W = params.W
	self.H = params.H
	self._lastFrameTouched = lmbx.FrameCount() -- Initialize touch timestamp
	self.IsDragging = false
	self.DragPos = { X = 0, Y = 0 }
	-- Set __close metamethod so it auto-cleans when used as a to-be-closed variable.
	local mt = getmetatable(self)
	mt.__close = Window.__close

	self.cursorX = 0
	self.cursorY = 0
	self.lineHeight = 0
	-- Initialize per-widget blocking regions for popup widgets
	self._widgetBlockedRegions = {}
	self._requestedNextLineSpacing = nil
	return self
end

--- Queue a drawing function under a specified numeric layer
function Window:QueueDrawAtLayer(layer, drawFunc, ...)
	-- Only integer layer values are supported
	DrawManager.Enqueue(self.id, layer, drawFunc, ...)
end

--- Hit test: is a point inside this window (including title bar, content area, and popups)?
function Window:_HitTest(x, y)
	-- Basic window bounds (title and content)
	local titleHeight = Globals.Defaults.TITLE_BAR_HEIGHT
	local basicBounds = x >= self.X and x <= self.X + self.W and y >= self.Y and y <= self.Y + titleHeight + self.H

	-- If basic bounds pass, return true
	if basicBounds then
		return true
	end

	-- Check if point is in any widget blocked regions (popups)
	if self._widgetBlockedRegions then
		for _, region in ipairs(self._widgetBlockedRegions) do
			if x >= region.x and x <= region.x + region.w and y >= region.y and y <= region.y + region.h then
				return true
			end
		end
	end

	return false
end

--- Update window logic: dragging only; mark touched only in Begin()
function Window:_UpdateLogic(mx, my, isFocused, pressed, down, released)
	-- Use static title bar height for dragging region
	local titleHeight = Globals.Defaults.TITLE_BAR_HEIGHT

	-- Start dragging if focused and pressed in title bar
	if isFocused and pressed and my >= self.Y and my <= self.Y + titleHeight then
		self.IsDragging = true
		self.DragPos = { X = mx - self.X, Y = my - self.Y }
	end

	-- Continue dragging while mouse button held
	if self.IsDragging then
		if down then
			self.X = mx - self.DragPos.X
			self.Y = my - self.DragPos.Y
		elseif released then
			self.IsDragging = false
		end
	end
end

--- Draw the entire window: chrome and queued widget layers
function Window:_Draw()
	draw.SetFont(Globals.Style.Font)
	local txtWidth, txtHeight = draw.GetTextSize(self.title)
	-- Draw title bar at static height and center text vertically
	local titleHeight = Globals.Defaults.TITLE_BAR_HEIGHT

	-- Background
	Common.SetColor(Globals.Colors.Window)
	-- Background covers title + content area (no extra padding)
	Common.DrawFilledRect(self.X, self.Y + titleHeight, self.X + self.W, self.Y + titleHeight + self.H)

	-- Title bar
	Common.SetColor(Globals.Colors.Title)
	Common.DrawFilledRect(self.X, self.Y, self.X + self.W, self.Y + titleHeight)

	-- Border
	if Globals.Style.EnableWindowBorder then
		Common.SetColor(Globals.Colors.WindowBorder)
		-- Outline around full window including title and content area
		Common.DrawOutlinedRect(self.X, self.Y, self.X + self.W, self.Y + titleHeight + self.H)
	end

	-- Title text
	Common.SetColor(Globals.Colors.Text)
	local titleX
	if self._hasHeaderTabs then
		titleX = self.X + Globals.Defaults.WINDOW_CONTENT_PADDING
	else
		titleX = self.X + (self.W - txtWidth) / 2
	end
	Common.DrawText(titleX, self.Y + (titleHeight - txtHeight) / 2, self.title)

	-- (All widget draw calls are now collected centrally by DrawManager)
end

--- Calculates widget position and updates window size if needed
--- @param width number The widget width
--- @param height number The widget height
--- @return number, number The x, y coordinates for the widget
function Window:AddWidget(width, height)
	local padding = Globals.Defaults.WINDOW_CONTENT_PADDING
	local x = self.cursorX
	local y = self.cursorY

	-- Calculate x position based on alignment
	if Globals.Style.Alignment == "center" then
		x = math.max(padding, math.floor((self.W - width) * 0.5))
	end

	-- Update window dimensions if needed
	self.W = math.max(self.W, x + width + padding)
	self.lineHeight = math.max(self.lineHeight, height)
	self.H = math.max(self.H, y + self.lineHeight)

	-- Update cursor position for the *next* widget on this line
	local horizontalSpacing = Globals.Style.ItemSpacingX or Globals.Defaults.ITEM_SPACING
	self.cursorX = self.cursorX + width + horizontalSpacing

	return x, y
end

--- Provide a simple way to "new line" to place subsequent widgets below
--- Resets horizontal position and advances vertically.
function Window:NextLine(spacing)
	local baseSpacing = Globals.Style.ItemSpacingY or Globals.Defaults.WINDOW_CONTENT_PADDING
	spacing = spacing or baseSpacing
	if self._requestedNextLineSpacing then
		spacing = math.max(spacing, self._requestedNextLineSpacing)
		self._requestedNextLineSpacing = nil
	end
	self.cursorY = self.cursorY + self.lineHeight + spacing
	self.cursorX = Globals.Defaults.WINDOW_CONTENT_PADDING -- reset to left padding
	local endOfLineY = self.cursorY -- Y position *before* resetting lineHeight
	self.lineHeight = 0
	-- Expand window if needed, considering the end of the previous line
	self.H = math.max(self.H, endOfLineY)
end

--- Advances the cursor horizontally to place the next widget on the same line.
function Window:SameLine(spacing)
	local defaultSpacing = Globals.Style.ItemSpacingX or Globals.Defaults.ITEM_SPACING
	spacing = spacing or defaultSpacing
	self.cursorX = self.cursorX + spacing -- Add specified spacing
	-- Note: We don't add widget width here, AddWidget already does that
	-- and advances cursorX *after* returning the position.
end

--- Adds vertical spacing without resetting the horizontal cursor position.
function Window:Spacing(verticalSpacing)
	local baseSpacing = Globals.Style.ItemSpacingY or Globals.Defaults.WINDOW_CONTENT_PADDING
	verticalSpacing = verticalSpacing or math.floor(baseSpacing * 0.5)
	-- Use current line height + spacing to advance Y
	self.cursorY = self.cursorY + self.lineHeight + verticalSpacing
	self.lineHeight = 0 -- Reset line height for the *next* line that might start here
	-- Expand window if needed
	if self.cursorY > self.H then
		self.H = self.cursorY
	end
	-- Important: Do NOT reset cursorX here.
end

--- Allows a widget to request a minimum spacing before the next line starts.
function Window:RequestNextLineSpacing(minSpacing)
	if type(minSpacing) ~= "number" then
		return
	end
	if minSpacing <= 0 then
		return
	end
	if not self._requestedNextLineSpacing or minSpacing > self._requestedNextLineSpacing then
		self._requestedNextLineSpacing = minSpacing
	end
end

--- Reset the layout cursor for widgets (called on Begin)
function Window:resetCursor()
	local padding = Globals.Defaults.WINDOW_CONTENT_PADDING
	self.cursorX = padding
	self.cursorY = Globals.Defaults.TITLE_BAR_HEIGHT + padding
	self.lineHeight = 0
	self._requestedNextLineSpacing = nil
	-- Clear any widget blocking regions at start of frame
	self._widgetBlockedRegions = {}
	-- Clear header tabs flag so titles center if no header tabs
	self._hasHeaderTabs = false
	-- Reset window size to defaults to allow shrinking
	self.W = Globals.Defaults.DEFAULT_W
	self.H = Globals.Defaults.DEFAULT_H
	-- Clear sector sizes to allow sectors to shrink each frame
	self._sectorSizes = {}
end

return Window

end)
return __bundle_require("__root")